import React from 'react';
import { useNavigate } from 'react-router-dom';

const Inicio = () => {
    const navigate = useNavigate();

    const handleInvitado = () => {
        navigate('/Lugares'); // Cambia a la ruta deseada
    };

    const handleIniciarSesion = () => {
        navigate('/Ingreso'); // Cambia a la ruta de inicio de sesión
    };

    return (
        <div className="inicio-container">
            <h2>¡Bienvenido!</h2>
            <p>¿Cómo deseas continuar?</p>
            <button onClick={handleInvitado}>Seguir como invitado</button>
            <button onClick={handleIniciarSesion}>Iniciar sesión</button>
        </div>
    );
};

export default Inicio;
